import React, { Component } from 'react';
import { Line } from 'react-chartjs-2';
import {
    Chart as ChartJS,
    LineElement,
    CategoryScale,
    LinearScale,
    PointElement
} from 'chart.js'

ChartJS.register(
    LineElement,
    CategoryScale,
    LinearScale,
    PointElement
)



const options = {};


export default class Graph extends Component {

    data = {
        labels: [1, 2, 3],
        datasets: [{
            data: [4, 5, 7],
            backgroundColor: 'transparent',
            borderColor: '#f26c6d'
        }]
    }

    options = {};






	render() {
		return (
			<div>
				<br />

				<div className="title">Graph</div>
                <div style={{width: '500px', height: '500px', marginLeft: '20px'}}>
                    <Line data={this.props.graph.data} options={options}></Line>
                </div>

                <div>
                    {this.props.graph.data.labels}
                </div>
			</div>
		);
	}
}
